def Convert(string):
    li = list(string.split("	"))
    for i in range(len(li)):
        li[i]=int(li[i])
    size = int(len(li)/16)
    liste = [[],[],[],[],[],[],[],[],[],[],[],[],[],[],[],[]]
    for i in range(16):
        for n in range(size):
            liste[i].append(li[n])
        li = li[size:]
    return liste


